Полное описание:
Швабра-лентяйка Cleaner 360 с вертикальным отжимом по типу конструкции относится к флаудерам, но более модернизированным за счет вращающегося механизма и системы отжима. Приспособление гарантирует чистоту за считанные минуты. Лентяйка отлично справляется с труднодоступными местами, отмывает углы, плинтусы и что важно - бережно относится к любому типу покрытий.

Характеристики:
Материал штанги - сталь, пластик;
Материал моющей накладки - микрофибра;
Степень отжима - высокая;
Габариты головки швабры - 38 х 12 см
Длина штанги в разложенном виде - 150 см, в сложенном - 110.
Швабра лентяйка Cleaner 360 с вертикальным отжимом представляет собой складывающуюся ручку и плоскую головку, на которую крепится специальная микрофибра. На ручке есть приспособление, которое отжимает микрофибру и удаляет с неё частички мусора.

Настенные магнитные держатели для ножей - это прекрасная современная альтернатива обычным подставкам для ножей. Они представляют собой пару мощных, надежных и безопасных магнитных полос в пластиковом корпусе.

Преимущества:

- легкая установка;
- удобство и безопасность хранения ножей на настенном магните;
- экономия кухонного пространства;
- хорошая видимость, порядок и быстрый доступ к необходимому ножу в любой момент;
- предотвращение повреждения лезвий ножей (затупления, ржавления, образования засечек и зазубрин),
- легкая чистка.

Длина - 38 см; 

Ширина - 5 см; 

Материал - цветной пластик с магнитными вставками 

Цвет- черный 

В комплект входит:

- магнитный держатель - 1 шт.
- шурупы - 2 шт.

