Минифрезер может быть использован для натуральных ногтей,а также искусственных ногтей.
Идеально подходит для профессионального или домашнего использования.
регулировка скорости: 3000 об/мин до 20000 оборотов в минуту.
Многоцелевой: резьба, гравировка, маршрутизации, шлифовки, заточки, шлифования, полировка, сверление.
Комплектация:

- фрезер - маникюр, педикюр;
- 1 шт. адаптер переменного тока;
- 6 шт. алмазных насадок;
- 6 шт. шлифовальных насадок.

Лапшерезка с насадками для спагетти, пасты. Можно делать тонкую лапшу или широкие полоски лагмана. Да и еще не менее важный довод: состав теста для лапши я буду знать точно! В это тесто не будут добавлены сомнительные ингредиенты и всякие консерванты и усилители вкуса! Также с помощью лапшерезки можно раскатать тесто для мантов, пельменей. Это очень удобно!

- Тип: лапшерезка;
- Материал: нержавеющая сталь;
- Цвет: металлик.

