Кувшин выполнен из высококачественного стекла и пластика. Удобная форма носика и крышка позволяет защитить ваш напиток от попадания излишних запахов в ваш напиток. Подходит для: соков, морсов, компотов и любых интересных для Вас напитков. Кувшин так же имеет удобную ручку, которая упрощает использование его. За счет гладкой поверхности, изделие легко мыть. Подходит для мытья в посудомоечной машине.

- материал: термостойкое стекло;
- цвет: прозрачный;
- кувшин: 1500 мл;
- вес: 1250 г;
- страна производитель: РОССИЯ.

Разделочные гибкие доски 4 в 1 - это комплект ярких досок для разных видов продуктов. Гибкость изделия поможет аккуратно переложить измельченные продукты в посуду, не запачкав стол. В комплект входит 4 доски. Для удобства на каждой доске нанесено изображение, которое подскажет какой продукт на ней обрабатывать. Доски выполнены из пищевого пластика.
Эти доски прекрасно подходят для ножей из любого материала. После нарезания продукта вы можете просто согнуть доску и пересыпать все содержимое в нужную емкость. Вам не придется дополнительно пачкать тарелки.

Преимущества:

- Легко моется и не впитывают влагу;
- В комплекте 4 доски с большой рабочей поверхностью;
- Простая система цветных индикаторов и рисунков для обозначения продукта, который можно резать на данной доске;
- Легко скручивается для удобного хранения и легкого перемещения нарезанных продуктов в кастрюлю, сковороду, тарел.

Насадка используется для защиты изделий во время глажения. Благодаря этой насадке вы исключите прилипание одежды к поверхности утюга и появление блеска на одежде, а значит, сможете сохранить свои вещи в идеальном состоянии намного дольше. 

Проста в использовании: 

- наденьте насадку на "подошву" выключенного утюга;
- закрепите пружину на платформе сзади утюга;
- включите утюг на нужный вам режим;
- можете приступать к глажению ваших вещей.

